</p><p><br/></p><p><br/></p><p style="margin: 0px; padding: 265px 0px 0px 20px; color: rgb(51, 51, 51); line-height: 55px; letter-spacing: 2px; font-size: 42px;">	大有动力,大有能效。</p><p><br/></p><p style="margin: 0px; padding: 20px 10px 0px 20px; width: 390px; line-height: 28px; font-size: 15px;">	新一代 A8 芯片基于 64 位台式电脑级架构，可提供更为强劲的动力，即使是驱动这样一个更大的显示屏也游刃有余。M8
