px; float: left;"><strong>双指滚动</strong><br/>	在 Multi-Touch 表面轻刷双指，即可沿着纵向、横向或对角线等任何方向滚动操作。</p><p>&nbsp;</p><p style="margin: 0px; padding: 260px 0px 0px 20px; width: 180px; line-height: 22px; font-size: 14px; float: left;"><strong>双指开合缩放</strong><br/>	开合双指以放大和缩小照片，放大网页中的字号，还可进行更多操作。</p><p>&nbsp;</p><p style="margin: 0px; padding: 260px 0px 0px 30px; width: 190px; line-height: 22px; font-size: 14px; float: left;"><strong>双击</strong><br/>	在 Multi-Touch 表面随处点按两次，可实现双击操作。 或在系统偏好设置中启用 &quot;轻拍点按&quot;，只要轻拍触控板两次即可进行同样的操作。</p><p>&nbsp;</p><p style="margin: 0px; padding: 260px 0px 0px 30px; width: 140px; line-height: 22px; font-size: 14px; float: left;"><strong>辅助点按/轻拍</strong><br/>	点击触控板一角或双指随处点按，即可执行右键点按功能。启用 &quot;轻拍点按&quot; 之后，随处轻拍双指即可进行同样的操作。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style="margin: 0px; padding: 50px 0px 0px; text-align: center; line-height: 65px; letter-spacing: 3px; font-size: 40px;">	了不起的<br/>	先进操作系统</p><p>&nbsp;</p><p style="margin: 0px; padding: 10px 30px 0px; text-align: center; line-height: 25px; font-size: 15px;">	你的 Mac 之所以如此直观易用，OS X 功不可没。<br/>	它专为 Mac 而打造，带给你一个密切整合的系统，让一切都配合得天衣无缝。<br/>	OS X 让每台 Mac 内蕴藏的强大技术得以充分发挥。而且，得益于 iCloud，OS X 使你的 Mac、iPhone、iPad 和 iPod touch 可以彼此默契配合。</p><p>&nbsp;</p><p style="margin: 0px; text-align: center; padding-top: 30px;"><img src="http://goodsimg.1yyg.com/GoodsInfo/20140709172842265.jpg"/></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style="margin: 0px; padding: 50px 0px 0px; text-align: center; line-height: 65px; letter-spacing: 3px; font-size: 40px;">	一系列强大的内置 App，<br/>	从生产力到创造力，无不得力。</p><p>&nbsp;</p><p style="margin: 0px; padding: 10px 30px 0px; text-align: center; line-height: 25px; font-size: 15px;">	iMac 配备 iPhoto、iMovie、GarageBand、Pages、Numbers 及 Keynote。<br/>	这样，你可以随时使用你的照片、视频、音乐、文档、电子表格和演示文稿来演绎无限创意。你还可以获得各种出色 app 来发送电子邮件、 管理日程安排和自动备份你的 Mac，甚至还有一款 app 可以让你在 Mac App Store 购买新 app。</p><p>&nbsp;</p><p style="margin: 0px; text-align: center; padding-top: 30px;"><img src="http://goodsimg.1yyg.